const CardComponent=()=>{
    return(
        <div class="card">
        <img src="image.jpg" alt="Card Image"/>
        <div class="card-content">
           
            <h3>Title</h3>
            <p>Description of the card content.</p>
            <a href="#" class="button">Read More</a>
           
        </div>
        </div>
    )
}
export default CardComponent
